import React from 'react'
import Item from "../utils/Item"

const OrderPrint   = () => {
    return (
        <div>
            <h2>Resumen de tu orden</h2>
                {orderPrint.map(product =>(
                   <Item
                   key = {product.id}
                   product = {product.productName}
                   cost = {product.cost}
                   />
                ))}
        </div>
    )
}

export default OrderPrint
